import { PlusIcon } from "@heroicons/react/outline";
import Rightbar from "../Sidebars/Rightbar.jsx";
import Posts from "./Posts.jsx";
import CreatediaryModal from "../Modals/CreatediaryModal.jsx";
import { useState } from 'react';
import OutsideClickHandler from 'react-outside-click-handler';
function Feed() {

    const[popCreatediary, setpopCreatediary] = useState(false);

    return (

    <div className="overflow-y-scroll">




                <div className="flex justify-center">
                {/* Button */}
                <OutsideClickHandler onOutsideClick={() => {setpopCreatediary(false);}}>
                     <div className="flex justify-center">
                        <div className="bg-gradient-to-r bg-gray-700 hover:from-pink-500 hover:to-yellow-500 flex justify-around m-4 py-1 text-sm px-4 items-center cursor-pointer  font-bold rounded-full shadow-xl"
                            onClick={ () => {setpopCreatediary(!popCreatediary)}}>
                            <PlusIcon className="p-0.5 h-6 text-white"/>
                            <p className="text-white">Diary Post</p>
                        </div>
                    </div>

                    {popCreatediary && <CreatediaryModal/>}
                </OutsideClickHandler>
                </div>


       <Posts/>


    </div>
    )
}

export default Feed;
